import React from "react";
import { View, Text } from "react-native";

export default function Endereco(props){
    return(
        <View>
            <Text>Lougradouro: {props.lougradouro}</Text>
            <Text>Bairro: {props.bairro}</Text>
            <Text>Cidade: {po}</Text>
        </View>
    )
}
